import React, { useEffect, useState } from 'react'

const StateWise = () => {

    const [data, setData] = useState({});

    const getData = async () => {
        const res = await fetch('https://api.covid19india.org/data.json');
        const actualData = await res.json();
        console.log(actualData);
        setData(actualData);
      }
      
      
      useEffect(() => {
              getData();
      }, []);

    return (
        <>
            <section className="container-fluid">
                <div className="row">
                  <h2 className="text-danger text-center fw-bold pt-5">Indian COVID-19 State Wise Data</h2>
                  <row className="text">
                      <div className="col-md-10 mx-auto">
                          <table className="table table-hover">
                              <thead className="bg-dark text-light">
                                  <tr>
                                      <th>State</th>
                                      <th>Confirmed</th>
                                      <th>Recovered</th>
                                      <th>Deaths</th>
                                      <th>Active</th>
                                      <th>Updated</th>
                                  </tr>
                              </thead>

                            <tbody>
                              <tr className="border border-secondary">
                                <td>State</td>
                                <td>Confirmed</td>
                                <td>Recovered</td>
                                <td>Deatds</td>
                                <td>Active</td>
                                <td>Updated</td>
                              </tr>
                            </tbody>
                          </table>
                      </div>
                  </row>
                </div>

            </section>
        </>
    );
};

export default StateWise
